import React, { useState } from "react";
import styles from "./NewUser.module.css";
import Container from "./UI/Container";
import RenderUser from "./RenderUser";

const NewUser = () => {
  const username = "";
  const age = "";

  const logUsername = (event) => {
    console.log(event.target.value);
    return username;
  };
  const logAge = (event) => {
    console.log(event.target.value);
    return username;
  };
  return (
    <>
      <Container>
        <label className={styles.username} for="username">
          Username
        </label>
        <input
          className={styles["username-field"]}
          onChange={logUsername}
          type="text"
          id="username"
        ></input>
        <label className={styles.age} for="age">
          Age (Years)
        </label>
        <input
          className={styles["age-field"]}
          type="number"
          id="age"
          onChange={logAge}
        ></input>

        <input className={styles.submit} type="button" value="Add user"></input>
      </Container>
      <RenderUser></RenderUser>
    </>
  );
};

export default NewUser;
